import React, {Component} from 'react';
import PHOTODATA from '../projects/PHOTO.js';
import s from './Projects.module.css';

{/*Create a component of the filter panel*/}

const FilterPanel = (props) => {
    
        if(props.lang === 'english') {
                return (
                <li className={s.imageHeading} onClick={props.onClick}>{props.category}</li>
            )
        } else {
            return (
                <li className={s.imageHeading} onClick={props.onClick}>{props.categoryRus}</li>
            )
            }
       

};

export default FilterPanel;
